import React from 'react';
import Song from './Song';
import songs from './data/songs.json';

const Playlist = () => {
  return (
    <div>
      <h1>My Playlist</h1>
      <ul>
        {songs.map(song => (
          <Song key={song.id} song={song} />
        ))}
      </ul>
    </div>
  );
};

export default Playlist;
